import React, { Component } from 'react';

import 'bootstrap/dist/css/bootstrap.css';
import Tab from 'react-bootstrap/Tab';
import Tabs from 'react-bootstrap/Tabs';


//import "bootstrap/dist/css/bootstrap.min.css";
//import { Link } from 'react-router-dom';

//import styles from "./styling.module.css";

export default class tabsBar extends Component {
  render() {
    
    const siteNames = this.props.siteNames;

    return (
      <Tabs defaultActiveKey="SITE_1" id="uncontrolled-tab-example" className="mb-3">
        <Tab eventKey="SITE_1" title="SITE_NAME_1">
          SITE_1
        </Tab>
        <Tab eventKey="SITE_2" title="SITE_NAME_2">
          SITE_2
        </Tab>
        <Tab eventKey="SITE_3" title="SITE_NAME_3" disabled>
          SITE_3
        </Tab>
    </Tabs>
    );
  }
}
